            "created": 1425580319000, 
            "description": "<p>We're encouraging women everywhere to celebrate <i>International Women's Day</i> by spending at least one hour on a code-related project this Sunday. No feat is too small!</p> <p>(This isn't physical meet up, but there's still plenty you can do!)</p> <p>You could work on your first app, figure out how to get your computer to recognize your device, finally find that bug in your code, start a new tutorial, help someone else get started, or add more test coverage. Anything you can think of that's code related. It's that simple!</p> <p><b>Post your Sunday accomplishments in the comments below, on Twitter (@WomenWhoCodeDC, #WomensDay), or join us on Slack to celebrate. </b></p> <p>We're excited to hear about all the things you get into!</p>", 
