            "created": 1424824280000, 
            "description": "<p><img src=\"https://raw.githubusercontent.com/maptime/dc/gh-pages/img/dcflag.png\" /></p> <p>Tim Abdella,\u00a0GIO\u00a0for the Government of the District of Columbia, will talk about the\u00a0District\u2019s\u00a0open GIS data\u00a0site\u00a0(<a href=\"http://data.dc.gov/\"><a href=\"http://data.dc.gov\" class=\"linkified\">http://data.dc.gov</a></a>) -- the\u00a0600+\u00a0spatial datasets the\u00a0District\u00a0has available for anyone to use\u00a0for research, analysis, product creation and more!\u00a0He will also\u00a0showcase\u00a0the many geospatial apps and tools the\u00a0District\u00a0has built for\u00a0residents,\u00a0such as tracking snowplows\u00a0and\u00a0finding property information and permits.\u00a0Come ready to offer your\u00a0feedback on\u00a0what you would like to see\u00a0happening next with DC's GIS data!</p> <p><br/>Bring a laptop so you can use the data and tools yourself!</p>", 
