            "created": 1423625127000, 
            "description": "<p>Bike Hack Night is a show &amp; tell of bicycle-related apps, data visualizations, and gadgets. Doors open at 6:30 for snacks and beer, with speakers starting at 7:00. We will be in\u00a0Congressional Ballroom A.\u00a0Our speakers so far include:</p> <p>\u2022\u00a0Ola\u00a0G\u00f6ransson of the\u00a0<a href=\"http://www.houseofsweden.com/en/Embassy-of-Sweden/\">Embassy of Sweden</a>\u00a0will show us the\u00a0<a href=\"http://www.hovding.com/\">H\u00f6vding</a>, the\u00a0\"invisible\" bike helmet.</p> <p>\u2022\u00a0<a href=\"https://twitter.com/johnelliottdc\">John Elliott</a>\u00a0will demo his\u00a0<a href=\"http://waybot.tumblr.com/\">Waybot</a>\u00a0hardware bicycle traffic counter to display bike traffic counts live in the browser.\u00a0</p> <p>\u2022\u00a0Hans Lellelid will demo his\u00a0<a href=\"http://freezingsaddles.com/\">Freezing Saddles</a>\u00a0web site.\u00a0</p> <p>\u2022\u00a0Thomas Stokell will show us Atlanta's <a href=\"http://lovetoride.org/\">Love to Ride</a>\u00a0program.\u00a0</p> <p>\u2022\u00a0Steve Sanders will show how the\u00a0<a href=\"http://www1.umn.edu/pts/bike/\">University of Minnesota</a>\u00a0uses RFID technology to record and reward bike trips.\u00a0</p> <p><br/>\u2022\u00a0Tracy Hadden Loh of the\u00a0<a href=\"http://www.railstotrails.org/\">Rails-to-Trails Conservancy</a> will show us their app for ad-hoc bike and pedestrian counts.\u00a0</p> <p>\u2022 <a href=\"https://twitter.com/bikepedantic\">Darren Buck</a> of <a href=\"http://ddot.dc.gov/page/bicycle-program\">DDOT's Bicycle Program</a> will share data from the new automatic bike counters and manual counts.\u00a0</p> <p>\u2022 Eric Weis of the\u00a0<a href=\"http://www.greenway.org/\">East Coast Greenway Alliance</a> will demo their\u00a0smartphone app and their web-based <a href=\"http://map.greenway.org/\">Trip Planner</a>.\u00a0</p> <p>\u2022\u00a0Carey Anne\u00a0Nadeau of <a href=\"http://opendatadiscourse.com/\">Open Data Discourse</a> will share biking insights gained from Cambridge's\u00a0civic challenge.\u00a0</p> <p><br/>Do you have a project you're like to share? Contact\u00a0<a href=\"http://www.meetup.com/Transportation-Techies/members/10550542/\">Michael</a>\u00a0to be added to the agenda.</p> <p>We are being hosted by the\u00a0<a href=\"http://bikeleague.org/\">League of American Bicyclists</a>\u00a0at the\u00a0<a href=\"http://bikeleague.org/content/summit-2015\">National Bike Summit</a>. (There is no need to register for the summit in order to attend this meetup.) Many thanks to our sponsors at\u00a0<a href=\"http://mobilitylab.org/\">Mobility Lab</a>\u00a0and\u00a0<a href=\"https://www.twilio.com/\">Twilio</a>.</p> <p>Visit\u00a0<a href=\"http://www.meetup.com/Transportation-Techies/events/168585592/\">Bike Hack Night I</a> and\u00a0<a href=\"http://www.meetup.com/Transportation-Techies/events/200015252/\">Bike Hack Night II</a> to see what was presented at previous events. Read summaries at\u00a0<a href=\"http://mobilitylab.org/2014/05/28/transportation-techies-show-what-can-be-done-with-bike-data/\">Transportation Techies Show What Can Be Done With Bike Data</a> and\u00a0<a href=\"http://mobilitylab.org/2014/11/13/d-c-using-data-to-envision-bike-lanes-of-the-future/\">D.C. Using Data to Envision Bike Lanes of the Future</a>.</p> <p>Follow\u00a0<a href=\"https://twitter.com/techiesdc\">@techiesdc</a>\u00a0for \"Transportation Techies\" updates.</p>", 
