            "description": "<p>Please join us next Thursday, March 12th for an exploration of R's Grammar of Graphics package ecosystem. We'll have three different overviews, more details to follow.</p> <p>\u2022\u00a0<a href=\"http://ggplot2.org/\">ggplot</a></p> <p>\u2022\u00a0<a href=\"http://ggvis.rstudio.com/\">ggvis</a></p> <p>\u2022\u00a0<a href=\"http://cran.r-project.org/web/packages/ggmap/index.html\">ggmap</a></p> <p>All of these packages are based on <a href=\"http://had.co.nz/\">Hadley Wickham's</a> implementation of <a href=\"http://www.cs.uic.edu/~wilkinson/TheGrammarOfGraphics/GOG.html\">Leland Wilkinson's Grammar of Graphics</a>.</p> <p>Agenda:</p> <p>6:30 - 7:00 - Food, drinks, networking<br/>7:00 - 7:10 - Intros and announcements<br/>7:10 - 8:30ish - Presentations<br/>8:30 - Data Drinks</p>", 
