            "created": 1424051129000, 
            "description": "<p>Want to learn more about async apps in python?\u00a0</p> <p><a href=\"https://github.com/makaimc\">Matt Makai</a>, Developer Evangelist at\u00a0<a href=\"https://www.twilio.com/blog/2014/02/introducing-developer-evangelist-matt-makai.html\">Twilio</a>, speaking to us about asynchronous Python web apps. \u00a0<b>Matt is a great presenter and makes difficult concepts easy to understand. You should feel comfortable asking questions during the talk when you have them.\u00a0</b>Matt delivered a previous version of this talk to San Francisco's Python meetup to rave reviews in January.\u00a0</p> <p>(If you don't know what async is and want to understand a little more before the talk -- here is an async talk from PyCon 2014: <a href=\"https://speakerdeck.com/pycon2014/what-is-async-how-does-it-work-and-when-should-i-use-it-by-a-jesse-jiryu-davis\">Slides </a>&amp; <a href=\"https://www.youtube.com/watch?v=9WV7juNmyE8\">Video</a>.)</p> <p>\n\niStrategyLabs is hosting will also provide food and drink, so you can come hungry!</p> <p>\n\n\nAgenda:</p> <p>\n\n\n\u2022 6:30-7:00pm - Arrive, eat, and catch up\u00a0</p> <p>\n\n\u2022 7:00-7:15pm - Announcements\u00a0</p> <p>\n\n\u2022 7:15-8:15pm - Talk, Q&amp;A\u00a0</p> <p>\n\n\u2022 8:15-8:30pm - Wrap-up\u00a0</p> <p>\n\n\u2022 8:30pm - Migrate to a social venue nearby</p> <p>\n\nAbout the talk:</p> <p>\n\nWhy should Node.js folks have all the asynchronous web application fun?\u00a0 In this talk you'll learn how to use WebSockets with Python, Flask and gevent to build full-duplex communications into your web apps. We'll live code from a blank file to a completed app that updates vote counters in a web browser via WebSockets without page refreshes. Along the way you'll learn good practices to follow when working with virtualenv and Python application dependencies.\u00a0</p> <p>About Matt:</p> <p>\n\n<a href=\"https://github.com/makaimc\">Matt Makai</a>\u00a0(<a href=\"https://twitter.com/mattmakai\">@mattmakai</a>) is a\u00a0<a href=\"https://www.twilio.com/blog/2014/02/introducing-developer-evangelist-matt-makai.html\">Twilio Developer Evangelist</a>\u00a0and Python web developer based in Washington, D.C. He was a speaker in 2014 at\u00a0<a href=\"https://www.youtube.com/watch?v=s6NaOKD40rY\">EuroPython</a>\u00a0and\u00a0<a href=\"https://www.youtube.com/watch?v=aMtiCX38w20\">DjangoCon US</a>\u00a0and will be speaking in Montreal at PyCon 2015 with the talks \"<a href=\"https://us.pycon.org/2015/schedule/presentation/336/\">Choose Your Own WSGI Deployment Adventure</a>\" and \"<a href=\"https://us.pycon.org/2015/schedule/presentation/421/\">virtualenv for New Pythonistas</a>\".\u00a0Matt has contributed to the Ansible project and programmed the\u00a0<a href=\"https://pypi.python.org/pypi/underwear/0.4.5\">Underwear</a>\u00a0and\u00a0<a href=\"https://pypi.python.org/pypi/plushcap/0.2.2\">Plushcap</a>\u00a0libraries hosted on PyPI. He also writes the\u00a0<a href=\"http://www.fullstackpython.com/\">Full Stack Python</a>\u00a0website read by over 15,000 developers a month to help them understand how to build and deploy their WSGI-powered web applications.</p> <p>(This month, we are partnering with\u00a0<a href=\"http://www.meetup.com/django-district/events/220439364/\">Django District</a>, to co-host an event.)</p>", 
