            "created": 1424747085000, 
            "description": "<p>Are you curious if social media generated data has any relationship to security prices? Do you think news sentiment can give you an edge trading stocks, what about tweet sentiments? Do you want to learn some cutting edge trading strategies? If so, please join us for a special Data Science MD event featuring Johns Hopkins graduate students presenting their research findings.\u00a0</p> <p><b>Agenda</b></p> <p>6:30 PM -- Networking &amp; Food\u00a0</p> <p>6:55 PM -- Greetings</p> <p>(1) <i>Welcome Guests</i> - Prof Dan Naiman, <a href=\"http://carey.jhu.edu/faculty-research/directory/federico-m-bandi-phd/\">Prof Federico Bandi</a>, and\u00a0<a href=\"http://carey.jhu.edu/faculty-research/directory/jim-kyung-soo-liew-phd\">Prof Jim Liew</a></p> <p>(2)<i>\u00a0Twitter Sentiment and IPO Performance: A Cross-Sectional Examination</i> -\u00a0Garrett Wang</p> <p>(3)\u00a0<i>Re-Examination of Crowdsourced Earnings Forecasts from Estimize -\u00a0</i>Guo Shenghan</p> <p>(4)\u00a0<i>Data Mining Methods in Trading Strategies</i> -\u00a0Wendi Zhu</p> <p>(5) <i>TBD </i>- Tongli Zhang / Yashu (Kimi) Yang\u00a0</p> <p>(6)<i>\u00a0The Influence of Extreme News</i> -\u00a0Xinwen (Steven) Chen</p> <p>(7)\u00a0<i>Customer-Momentum Alpha Strategy and Improvements </i>- Binbin (Kevin )\u00a0Jin</p> <p>(8) <i>Conclusions </i>- Prof Dan Naiman, Prof Federico Bandi, and\u00a0Prof Jim Liew</p> <p>9:00 PM -- Post event drinks at Four Seasons - Wit and Wisdom</p> <p><b>Location</b></p> <p><a href=\"http://maps.google.com/maps?f=q&amp;hl=en&amp;q=100+International+Drive%2C+Baltimore%2C+MD%2C+21202%2C+us\">Johns Hopkins Carey Business School</a></p> <p>Legg Mason Building, 2nd Floor, Room[masked]</p> <p><br/>100 International Drive,\u00a0Baltimore,\u00a0MD</p> <p><b>Parking</b></p> <p>Stay on the roundabout and take next (3rd) right onto President Street. Turn right into the garage. Take the elevator to the building lobby. We will provide an escort service to area parking garages upon request. Contact[masked] for additional information.</p> <p><br/>Parking is ample in the Legg Mason building and/or Four Seasons.\u00a0$9 after\u00a05 PM.</p> <p><b>School</b></p> <p><img src=\"http://photos2.meetupstatic.com/photos/event/8/8/b/6/600_434854998.jpeg\" /></p> <p><a href=\"http://carey.jhu.edu/\">Johns Hopkins Carey Business School</a>\u00a0in conjunction with J<a href=\"http://engineering.jhu.edu/ams/\">ohns Hopkins Whiting School of Engineering - Department of Applied Mathematics &amp; Statistics</a> cordially invite you to a night of fantastic quantitative research discoveries!</p> <p><b>Post-event Drinks<br/></b></p> <p><img src=\"http://photos3.meetupstatic.com/photos/event/1/5/c/3/600_434645571.jpeg\" /></p> <p><b>Four Seasons</b></p> <p><b><a href=\"http://www.witandwisdombaltimore.com/\">Wit and Wisdom</a></b></p> <p>200 International Drive, Baltimore, MD 21202</p>", 
