            "created": 1425314135000, 
            "description": "<p>NOTE: You MUST register on\u00a0<a href=\"http://wcm-ux4devs.eventbrite.com\">Eventbrite</a>.\u00a0</p> <p><b>OVERVIEW</b></p> <p>Join Web Content Mavens for a discussion about user experience in app and web development projects, making devs into UXers and practical UX in real-world projects.</p> <p>Key discussion points:</p> <p>- Practical UX principles that devs &amp; techies need to know</p> <p>- How to make developers into UXers\u00a0</p> <p>- UX when you don't have UX staff or expertise</p> <p><br/>- Making theoretical UX work in a real dev environment</p> <p>- Good processes for UX in development</p> <p><b>SCHEDULE</b></p> <p>Come at 6:30 for empanadas, drinks (adult &amp; otherwise) and networking. The panel begins at 7:00 and ends by 8:30. There will be a raffle from our host, Teksystems, so stay until the end!</p> <p><b>SPEAKERS</b></p> <p>\u2022\u00a0Scott Savage, Boost Labs</p> <p>\u2022\u00a0Cobey Potter, Wellfire Interactive\u00a0</p> <p>\u2022\u00a0Jordan DeVries, BraveUX</p> <p><b>OUR SPONSOR</b></p> <p><img src=\"http://photos1.meetupstatic.com/photos/event/5/5/c/a/600_434841962.jpeg\" /></p> <p><b>TEKsystems:</b> People are at the heart of every successful business initiative. At TEKsystems, we understand people. Every year we deploy over 80,000 IT professionals at 6,000 client sites across North America, Europe and Asia. Our deep insights into IT human capital management enable us to help our clients achieve their business goals - while optimizing their IT workforce strategies. We provide IT staffing solutions, IT talent management expertise and IT services to help our clients plan, build and run their critical business initiatives. Through our range of quality-focused delivery models, we meet our clients where they are, and take them where they want to go, the way they want to get there. <a href=\"http://www.teksystems.com\">www.teksystems.com.</a></p>", 
