            "created": 1425357740000, 
            "description": "<p>RSVP here too:\u00a0<a href=\"http://www.meetup.com/DC-Tech-Meetup/events/213904822/\"><a href=\"http://www.meetup.com/DC-Tech-Meetup/events/213904822/\" class=\"linkified\">http://www.meetup.com/DC-Tech-Meetup/events/213904822/</a></a></p> <p>DC Tech is the largest tech meetup in the city and they have all sorts of really awesome demos to show fantastic startups / organizations / hacks that are going on around the DMV.</p> <p>They are awesome (and you get to meet so many great people! But the event is quite huge - only a casual 400+ DCers haha - which means it can be easy to feel a bit lost, and we've heard other people mention that too.</p> <p>SO we were talking with fantastic DC Tech organizers Shana and Stephanie, and thought it might be cool for us all to sign up <i>here</i> and then we can meet each other at the event and not be ~lonely~. Seems like a win to us. Also if you have a cool talk / demo to present, fill out the form <a href=\"https://docs.google.com/forms/d/1mmDpj-V3dKEcoobPwfLV8dUk3_5alWWvXgSUnfQD53g/viewform?formkey=dE1kMVZMT0hJV0dvS1Raa2pXbXRTTUE6MA#gid=0\"><b>here</b></a>!</p> <p>We use Slack (a chat client) a lot at events to communicate, so if you're coming to the meetup and want to chat - or just want to join our chat room in general - fill out your information <a href=\"https://docs.google.com/forms/d/1BXxIJuCawYt3pEzN7-6CgdT6XrhvG0KYQpOqdmv98DY/viewform\"><b>here</b></a>\u00a0and we'll send over an invite.</p> <p>PS - it's at a theater this month?! Haven't been here before but that just sounds really brilliant!</p>", 
