            "description": "<p><b>IMPORTANT: </b>-<b>\u00a0</b>Registration is through <a href=\"http://wcm-marcom.eventbrite.com\">Eventbrite</a>.\u00a0</p> <p><b>OVERVIEW</b></p> <p>Join the Web Content Mavens and learn about managing marketing and communications across multiple channels - including web, email, social and mobile.\u00a0</p> <p><br/><b>SPEAKERS</b></p> <p><b>Brenna Holmes</b>, VP of Digital, Chapman, Cubine, Adams + Hussey</p> <p><b>Heather Shelby</b>, Online Activist Coordinator, Environmental Defense Fund</p> <p><b>Shashi Bellamkonda</b>,\u00a0VP of Digital Marketing, The Bozzuto Group</p> <p><b>AGENDA</b></p> <p><br/>6:30 pm - Networking, drinks and appetizers<br/>7:00 pm - Presentations<br/>8:15 pm - More networking<br/>8:45 pm - Adjourn</p> <p><b>OUR SPONSOR</b></p> <p><img src=\"http://photos3.meetupstatic.com/photos/event/8/2/f/e/600_434193534.jpeg\" /></p> <p>What\u2019s next?\u00a0Chapman Cubine Adams + Hussey (CCAH) has been seeking an answer to this question for more than 25 years. We\u2019re driven to discover what\u2019s next\u00a0in multi-channel marketing and how we can help our clients test new ideas, embrace innovation and break through the clutter. <a href=\"http://www.ccah.com\">www.ccah.com</a></p>", 
