            "created": 1423021750000, 
            "description": "<p>(<i>Please note that you need to get a ticket through Eventbrite to attend:\u00a0<a href=\"http://bamgdc.eventbrite.com/?aff=DCDevMeetup\"><a href=\"http://bamgdc.eventbrite.com/?aff=DCDevMeetup\" class=\"linkified\">http://bamgdc.eventbrite.com/?aff=DCDevMeetup</a></a></i>)</p> <p><img src=\"http://photos4.meetupstatic.com/photos/event/2/f/4/a/600_433992106.jpeg\" /></p> <p>\n\nThe Code Kitchen and Big Android Meat &amp; Greet in the Washington, DC metro area on Saturday, April 4, 2015.</p> <p><br/>During the day, developers of any skill level can devour code challenges in our Code Kitchen, testing their Android know-how by solving one, two, or all of the challenges on our Code Kitchen Menu.</p> <p>Want to extend the fun? Purchase a ticket for our evening event the Big Android Meat and Greet - join us as we dig into some world-famous Big Android BBQ and sail into the sunset on the historic Cherry Blossom riverboat with our crew, sponsors, and other Android enthusiasts just like you!</p> <p><b>Tickets are available here: <a href=\"http://bamgdc.eventbrite.com/?aff=DCDevMeetup\"><a href=\"http://bamgdc.eventbrite.com/?aff=DCDevMeetup\" class=\"linkified\">http://bamgdc.eventbrite.com/?aff=DCDevMeetup</a></a></b></p> <p><br/><b>More info: <a href=\"http://bamg.ideaa.io/dc/\"><a href=\"http://bamg.ideaa.io/dc/\" class=\"linkified\">http://bamg.ideaa.io/dc/</a></a></b></p>", 
